    public function getSourceContext()
    {
        return new Source("{% use 'form_div_layout.html.twig' %}

{% block form_row %}
    <div class=\"form-group\">
        <label for=\"{{ id }}\" class=\"required\">{{ label }}</label>
        {{- form_errors(form) -}}
        {{- form_widget(form,{attr:{class:'Form-control Form-control-sm'}}) -}}
        {{- form_help(form) -}}
    </div>
{% endblock %}

{% block choice_row %}
    <div class=\"form-group\">
        <label for=\"{{ id }}\" class=\"required\">{{ label }}</label>
        {{- form_errors(form) -}}
        {{- form_widget(form,{attr:{class:'Form-control Form-control-sm'}}) -}}
        {{- form_help(form) -}}
    </div>

{% endblock %}

{% block file_row %}
    <div class=\"form-group\">
        <label for=\"{{ id }}\" class=\"required\">{{ label }}</label>
        {{- form_errors(form) -}}
        {{- form_widget(form,{attr:{class:'file-upload-default'}}) -}}
        <div class=\"input-group col-xs-12\">
            <input type=\"text\" class=\"form-control file-upload-info\" disabled
                   placeholder=\"aucun fichier\">
            <span class=\"input-group-append\">
                                            <button class=\"file-upload-browse btn btn-outline-primary btn-icon-text\"
                                                    type=\"button\"><i class=\"ti-upload btn-icon-prepend\"
                                                                     style=\"font-size: 0.85rem\"></i> Télécharger</button>
                                        </span>
        </div>
        {{- form_help(form) -}}
    </div>
{% endblock %}

{% block checkbox_row %}
    {{- form_errors(form) -}}
    <div class=\"mb-4\">
        <div class=\"form-check\">
            <label for=\"{{ id }}\" class=\"form-check-label\">
                {{- form_widget(form,{attr:{class:'Form-check-input'}}) -}}
                {{ label }}
            </label>
            {{- form_help(form) -}}
        </div>
    </div>
{% endblock %}

{%- block form_errors -%}
    {%- if errors|length > 0 -%}
        <ul>
            {%- for error in errors -%}
                <li class=\"text-danger\">{{ error.message }}</li>
            {%- endfor -%}
        </ul>
    {%- endif -%}
{%- endblock form_errors -%}
{% block form_help -%}
    {%- if help is not empty -%}
        {%- set help_attr = help_attr|merge({class: 'text-info'|trim}) -%}
        <p id=\"{{ id }}_help\"{% with { attr: help_attr } %}{{ block('attributes') }}{% endwith %}>
            {%- if translation_domain is same as(false) -%}
                {%- if help_html is same as(false) -%}
                    {{- help -}}
                {%- else -%}
                    {{- help|raw -}}
                {%- endif -%}
            {%- else -%}
                {%- if help_html is same as(false) -%}
                    {{- help|trans(help_translation_parameters, translation_domain) -}}
                {%- else -%}
                    {{- help|trans(help_translation_parameters, translation_domain)|raw -}}
                {%- endif -%}
            {%- endif -%}
        </p>
    {%- endif -%}
{%- endblock form_help %}

{%- block choice_widget_expanded -%}

    <div class=\"form-group\">
        {%- for child in form %}
            <div class=\"form-check\">
                <label class=\"form-check-label\">
                    {{- form_widget(child,{attr:{class:'Form-check-input'}}) -}}
                    {{- form_label(child, null, {translation_domain: choice_translation_domain}) -}}
                </label>
            </div>
        {% endfor -%}
    </div>
{%- endblock choice_widget_expanded -%}

{%- block form_label -%}
    {% if label is not same as(false) -%}
        {% if not compound -%}
            {% set label_attr = label_attr|merge({'for': id}) %}
        {%- endif -%}
        {% if required -%}
            {% set label_attr = label_attr|merge({'class': (label_attr.class|default('') ~ ' required')|trim}) %}
        {%- endif -%}
        {% if label is empty -%}
            {%- if label_format is not empty -%}
                {% set label = label_format|replace({
                    '%name%': name,
                    '%id%': id,
                }) %}
            {%- else -%}
                {% set label = name|humanize %}
            {%- endif -%}
        {%- endif -%}
        {%- if translation_domain is same as(false) -%}
            {%- if label_html is same as(false) -%}
                {{- label -}}
            {%- else -%}
                {{- label|raw -}}
            {%- endif -%}
        {%- else -%}
            {%- if label_html is same as(false) -%}
                {{- label|trans(label_translation_parameters, translation_domain) -}}
            {%- else -%}
                {{- label|trans(label_translation_parameters, translation_domain)|raw -}}
            {%- endif -%}
        {%- endif -%}
    {%- endif -%}
{%- endblock form_label -%}
", "form/tms_theme.html.twig", "C:\\IT\\Intern Projects\\NEST\\templates\\form\\tms_theme.html.twig");
    }
